function App() {
  const [movies, setMovies] = useState([]);

  function getApi() {
    const data = fetch(
      "https://api.themoviedb.org/3/discover/movie?api_key=078156dd673bf235bf77c9a7c83d01af&page=1"
    ).then((response) => response.json().then((data) => data));
    return data;
  }

  return <div className="App"></div>;
}

export default App;
